import { createSelector } from 'reselect';

const COLLECTION_ID_MAP = {
  hats: 1,
  sneakers: 2,
  jackets: 3,
  womens: 4,
  mens: 5,
};

const selectorShop = (state) => state.shop;

export const selectorShopCollections = createSelector(
  [selectorShop],
  (shop) => shop.coolections,
);
